import React from "react";
import TextFieldStyled from "@material-ui/core/TextField";
import {useFormPerfil} from "../../hooks/useForm";
import { useNavigate } from "react-router-dom";
import { Title, SaveEditProfile, EditProfileContainer } from "../../pages/profilepage/styled";
import { handleAdress } from "../../axiosRequests/user";
import Header from "../../components/Header/Header";

const Address = () => {
  useProtectedPage();
  const navigate = useNavigate();
  const [form, onChange, clear] = useFormPerfil({
    street: "",
    number: "",
    neighbourhood: "",
    city: "",
    state: "",
    complement: "",
  });

  const handleSubmission = (event) => {
    event.preventDefault();
    handleAdress(form, clear, navigate);
    navigate(-1);
    alert("Endereço alterado com sucesso!");
  };

  return (
    <>
      <Header />

      <EditProfileContainer>
      <TextFieldStyled
        onSubmit={handleSubmission}
        name="street"
        value={form.street}
        onChange={onChange}
        variant="outlined"
        label="Logradouro"
        required
      />
      <TextFieldStyled
        name="number"
        value={form.number}
        onChange={onChange}
        variant="outlined"
        label="Número"
        required
      />
      <TextFieldStyled
        name="complement"
        value={form.complement}
        onChange={onChange}
        variant="outlined"
        label="Complemento"
        required
      />
      <TextFieldStyled
        name="neighbourhood"
        value={form.neighbourhood}
        onChange={onChange}
        variant="outlined"
        label="Bairro"
        required
      />
      <TextFieldStyled
        name="city"
        value={form.city}
        onChange={onChange}
        variant="outlined"
        label="Cidade"
        required
      />
      <TextFieldStyled
        name="state"
        value={form.state}
        onChange={onChange}
        variant="outlined"
        label="Estado"
        required
      />
      <SaveEditProfile onClick={handleSubmission}>SALVAR</SaveEditProfile>
      </EditProfileContainer>
    </>
  );
};

export default Address;
